// src/pages/Profile.js
import React from "react";

const Profile = () => {
  return (
    <div className="min-h-screen bg-gray-100 pt-16 flex justify-center items-center">
      <div className="bg-white p-6 rounded-lg shadow-lg w-full max-w-md text-center">
        <h2 className="text-2xl font-bold mb-4">Welcome to Your Profile</h2>
        <p className="text-gray-700">This is your profile page. Customize it to display your details and settings.</p>
      </div>
    </div>
  );
};

export default Profile;
